import React from 'react';
import logo from '../assets/img/logorustaco.png';
import rustpmc1 from '../assets/img/rustpmc1.png';
import '../assets/styles.css';

const Navbar = () => (
  <nav
    className="navbar navbar-centered navbar-thin"
    style={{
      position: 'relative',
      minHeight: '36px',
      padding: 0,
      background: 'linear-gradient(90deg, #23201a 80%, #e25822 100%)',
      borderBottom: '2px solid var(--rust-orange)',
      boxShadow: 'var(--rust-shadow)',
      zIndex: 2,
      display: 'flex',
      alignItems: 'flex-end',
      justifyContent: 'center',
    }}
  >
    {/* Botones izquierda */}
    <div style={{
      display: 'flex',
      alignItems: 'center',
      gap: '1rem',
      flex: 1,
      justifyContent: 'flex-end',
      height: '100%',
      paddingBottom: '0.1rem'
    }}>
      <a href="/" className="nav-btn">Inicio</a>
      <a href="/events" className="nav-btn">Stats</a>
    </div>
    {/* Logo centrado y sobresaliente */}
    <div
      style={{
        display: 'flex',
        alignItems: 'flex-end',
        justifyContent: 'center',
        position: 'relative',
        zIndex: 10,
        height: '100%',
        minWidth: 0
      }}
    >
      <img
        src={logo}
        alt="Rustaco Logo"
        className="logo-animated"
        height={100}
        width={100}
        style={{
          marginBottom: '-32px',
          background: 'rgba(35,32,26,0.97)',
          borderRadius: '50%',
          boxShadow: '0 8px 32px #000a, 0 0 0 6px #e25822',
          objectFit: 'cover',
          border: '2.5px solid #23201a'
        }}
      />
    </div>
    {/* Botones derecha */}
    <div style={{
      display: 'flex',
      alignItems: 'center',
      gap: '1rem',
      flex: 1,
      justifyContent: 'flex-start',
      height: '100%',
      paddingBottom: '0.1rem'
    }}>
      <a href="/about" className="nav-btn">Nosotros</a>
      <a href="/contact" className="nav-btn">Contacto</a>
    </div>
  </nav>
);

const Header = () => (
  <header className="header" style={{
    marginTop: '5rem',
    padding: '4rem 0 4rem 0',
    textAlign: 'center',
    minHeight: '60vh',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center'
  }}>
    <h1 style={{
      fontSize: '2.5rem',
      color: 'var(--rust-orange)',
      letterSpacing: '2px',
      marginBottom: '1.5rem',
      textShadow: '2px 2px 8px #000a',
      fontWeight: 900,
      animation: 'fadeDown 1s cubic-bezier(.4,0,.2,1)'
    }}>
      Bienvenido a Rustaco Eventos
    </h1>
    <p style={{
      color: 'var(--rust-accent)',
      fontSize: '1.4rem',
      margin: 0,
      animation: 'fadeDown 1.2s cubic-bezier(.4,0,.2,1)'
    }}>
      Organización profesional de torneos y eventos en el mundo de Rust.
    </p>
  </header>
);

const EventIntro = () => (
  <section
    style={{
      maxWidth: 1300,
      minHeight: '100vh',
      margin: '0 auto',
      display: 'flex',
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center',
      padding: '0 2rem',
      textAlign: 'left',
      animation: 'fadeIn 1.2s',
      gap: '1.2rem' // junta más el texto y la imagen
    }}
  >
    <div
      style={{
        flex: 1.2,
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'flex-start',
        justifyContent: 'center'
      }}
    >
      <h2
        style={{
          color: 'var(--rust-orange)',
          marginBottom: '2rem',
          fontSize: '2.5rem',
          letterSpacing: '1px'
        }}
      >
        ¿De qué trata el evento?
      </h2>
      <p
        style={{
          color: '#f5f5f5',
          fontSize: '1.5rem',
          margin: 0,
          maxWidth: 600
        }}
      >
        Rustaco Eventos organiza competencias y torneos únicos en el universo de Rust, donde equipos y jugadores se enfrentan en desafíos de supervivencia, estrategia y habilidad. ¡Participa para ganar premios, reconocimiento y formar parte de la mejor comunidad de Rust en Latinoamérica!
      </p>
    </div>
    <div
      style={{
        flex: 1,
        display: 'flex',
        justifyContent: 'flex-start',
        alignItems: 'center',
        animation: 'imgSlideIn 1.2s'
      }}
    >
      <img
        src={rustpmc1}
        alt="Evento Rust"
        style={{
          width: '800px',
          maxWidth: '98vw',
          borderRadius: 0,
          boxShadow: 'none',
          objectFit: 'contain',
          marginLeft: '0.5rem',
          marginRight: 0,
          background: 'none',
          animation: 'imgPop 1.2s cubic-bezier(.4,0,.2,1)'
        }}
      />
    </div>
  </section>
);

// Animaciones CSS para la imagen
// Agrega esto a tu styles.css:
/*
@keyframes imgPop {
  0% { opacity: 0; transform: scale(0.92) translateY(40px);}
  80% { opacity: 1; transform: scale(1.04) translateY(-6px);}
  100% { opacity: 1; transform: scale(1) translateY(0);}
}
@keyframes imgSlideIn {
  0% { opacity: 0; transform: translateX(80px);}
  100% { opacity: 1; transform: translateX(0);}
}
*/

const AboutEvent = () => (
  <section style={{
    maxWidth: 900,
    minHeight: '100vh',
    margin: '0 auto',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
    padding: '0 2rem',
    textAlign: 'center',
    animation: 'fadeIn 1.4s'
  }}>
    <h2 style={{
      color: 'var(--rust-orange)',
      marginBottom: '2rem',
      fontSize: '2.5rem',
      letterSpacing: '1px'
    }}>
      Sobre el evento
    </h2>
    <p style={{ color: '#f5f5f5', fontSize: '1.5rem', margin: 0, maxWidth: 700 }}>
      Cada evento está diseñado para ofrecer una experiencia competitiva y divertida, con reglas claras, administración profesional y soporte para todos los participantes. Nos enfocamos en la transparencia, el juego limpio y la integración de nuevos jugadores. ¡Sigue nuestras redes para no perderte el próximo torneo!
    </p>
  </section>
);

const Footer = () => (
  <footer className="footer">
    &copy; {new Date().getFullYear()} Rustaco Eventos &mdash; Inspirado en Rust. Todos los derechos reservados.
  </footer>
);

const Home = () => (
  <>
    <Navbar />
    <Header />
    <EventIntro />
    <AboutEvent />
    <Footer />
  </>
);

export default Home;
